import { Fragment } from 'react'
import { Route, Switch, Redirect } from 'react-router-dom'

import HeaderNav from './components/HeaderNav'

function App() {
  return (
    <Fragment>
      <header>
        <HeaderNav />
      </header>
      <main>
        <Switch>
          <Route path='/' exact>
            <Redirect to='/' />
          </Route>
        </Switch>
      </main>
    </Fragment>
  );
}

export default App;
